import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap-icons/font/bootstrap-icons.css";
import { Outlet, Link } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <nav
        className="navbar navbar-expand-lg"
        style={{
          background: "linear-gradient(to right, #F8F9FA, #E3E7EB)",
          boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
          padding: "10px 20px",
        }}
      >
        <div className="container">
          {/* Brand Logo */}
          <a className="navbar-brand fw-bold" href="#">
            <img
              src="https://res.cloudinary.com/urbanclap/image/upload/t_high_res_category/w_108,dpr_2,fl_progressive:steep,q_auto:low,f_auto,c_limit/images/growth/home-screen/1687285683825-e6cf23.jpeg"
              alt="Logo"
              height="40"
              style={{ borderRadius: "8px" }}
            />
          </a>

          {/* Toggle Button for Mobile */}
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          {/* Navbar Links */}
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav mx-auto">
              {/* Blogs Link */}
              <li className="nav-item">
                <Link
                  to="/frontblog"
                  className="nav-link fw-bold ms-3"
                  style={{
                    color: "#2C3E50",
                    transition: "0.3s",
                  }}
                  onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
                  onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
                >
                  Blogs
                </Link>
              </li>

              {/* Category Link */}
              <li className="nav-item">
                <Link
                  to="/"
                  className="nav-link fw-bold ms-3"
                  style={{
                    color: "#2C3E50",
                    transition: "0.3s",
                  }}
                  onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
                  onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
                >
                  Category
                </Link>
              </li>

              {/* Location Selector */}
              <li className="nav-item dropdown">
                <a
                  className="nav-link dropdown-toggle"
                  href="#"
                  id="locationDropdown"
                  role="button"
                  data-bs-toggle="dropdown"
                  style={{ fontWeight: "bold", color: "#2C3E50" }}
                >
                  <i className="bi bi-geo-alt"></i> Chandigarh, India
                </a>
                <ul className="dropdown-menu">
                  <li>
                    <a className="dropdown-item" href="#">
                      Delhi
                    </a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#">
                      Mumbai
                    </a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#">
                      Bangalore
                    </a>
                  </li>
                </ul>
              </li>

              {/* Search Bar */}
              <li className="nav-item">
                <form className="d-flex">
                  <input
                    className="form-control me-2"
                    type="search"
                    placeholder="Search for 'Facial'"
                    style={{
                      borderRadius: "20px",
                      padding: "8px 15px",
                      border: "1px solid #B0BEC5",
                      outline: "none",
                    }}
                  />
                  <button
                    className="btn btn-secondary"
                    type="submit"
                    style={{
                      borderRadius: "20px",
                      fontWeight: "bold",
                      padding: "8px 15px",
                      backgroundColor: "#34495E",
                      color: "white",
                    }}
                  >
                    Search
                  </button>
                </form>
              </li>
            </ul>

            {/* Right-side Icons */}
            <div className="d-flex">
              <a
                href="#"
                className="me-3"
                style={{
                  color: "#2C3E50",
                  fontSize: "20px",
                  transition: "0.3s",
                }}
                onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
                onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
              >
                <i className="bi bi-cart3"></i>
              </a>
              <Link
                to="/SignUp"
                style={{
                  color: "#2C3E50",
                  fontSize: "20px",
                  transition: "0.3s",
                }}
                onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
                onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
              >
                <i className="ms-3 bi bi-person-circle"></i>
              </Link>
            </div>
          </div>
        </div>
      </nav>
      <Outlet />
    </>
  );
};

export default Navbar;
